  false,\n\t\"url\": null,\n\t\"notes\": \"The Cityu2019s Long-Term Sustainability
  Plan, PlaNYC, calls for City government to reduce greenhouse gas emissions produced
  by municipal operations 30% by 2017. A large part of this effort is retrofitting
  municipal buildings to become more energy efficient. This dataset lists energy efficiency
  projects at City buildings that are complete or in progress. Projects are listed
  by address, building name, and agency, and the dataset includes the estimated reduction
  in tons of GHG emissions associated with the project.\",\n\t\"license_title\": \"License
